          console.log(res.data);
          dispatch(dataSuccess(res.data))
        }).catch(err =>{
          console.log("Fail Fetching")
          dispatch(dataFailure())
        })
      }
    
      useEffect(()=>{
        getData()
      },[])

  return (
    <div>
        <form>
           <input type="number" placeholder='Enter Postal Code' /> 
           <input type="submit" value="Submit" />
        </form>
    </div>
  )
}

